import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

import { LoginComponent } from './login/login.component';
import { TopBarComponent } from './dashboard/top-bar/top-bar.component';
import { SidebarComponent } from './dashboard/sidebar/sidebar/sidebar.component';

const routes: Routes = [
  { path: '', component: LoginComponent }, // Default route shows the LoginComponent

  { path: 'admin/top-bar', component: TopBarComponent },
  { path: 'admin/sidebar', component: SidebarComponent },
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule],
})
export class AppRoutingModule {}
